import React, { Component } from 'react';
// import logo from '../images/Logos.ico';
import { Link } from 'react-router-dom';
// import SignOut from './SignOut';
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../../store';
import { Redirect } from 'react-router-dom';
import '../css/header.css'

class Header extends Component {
    render() {
        return (
            <header>
                <nav class="navbar navbar-expand-lg fixed-top menu">
                    <Link class="navbar-brand pl-2" to="/"><img src={require("../images/logo/logo.png")} width="30%" alt="" /></Link>

                    <button class="navbar-toggler mr-2" type="button" data-toggle="collapse" data-target="#navbarSupportedContent"
                        aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <i class="expand-icon fas fa-chevron-circle-down"></i>
                    </button>

                    <div class="collapse navbar-collapse float-right pr-2" id="navbarSupportedContent">

                        <ul class="navbar-nav ml-auto text-center">
                            <li class="nav-item ml-3 mr-3" data-toggle="collapse" data-target=".navbar-collapse.show">
                                <Link class="nav-link" to="/"><i class="fas fa-home"></i> Home</Link>
                            </li>
                            <li class="nav-item ml-3 mr-3" data-toggle="collapse" data-target=".navbar-collapse.show">
                                <Link class="nav-link" to="/store"><i class="fas fa-store"></i> Store</Link>
                            </li>
                            <li class="nav-item ml-3 mr-3" data-toggle="collapse" data-target=".navbar-collapse.show">
                                <Link class="nav-link" to='/signin'><i class="fas fa-sign-in-alt"></i> Sign In</Link>
                            </li>
                            <li class="nav-item ml-3 mr-3" data-toggle="collapse" data-target=".navbar-collapse.show">
                                <Link class="nav-link" to="/signup"><i class="fas fa-user-plus"></i> Register</Link>

                            </li>
                        </ul>

                    </div>

                </nav>
                <div class="backbox"></div>
            </header>
        )
    }
}

// export default connect(
//    'listSong,song,SongTitle,Images,Time,Cuaca,is_login, username', actions
// )(withRouter(Header));
export default withRouter(Header)
